import './App.css';
import React,{useState} from 'react';



function App() {
  const {state, setState} = useState({
    name: 'Annas',
    selectedFile: null
  })

  const handleChange = input=> e =>{
    setState({[input]: e.target.value});
  }  

  console.log(state.name);

  return (
    <div className="App">
      <form>
        <input
          type="text"
          value={'text'}
          onChange={handleChange}
        />

        <input
          type="file"
          value={'file'}
          onChange={handleChange}
        />
      </form>
    </div>
  );
}

export default App;
